import RSVP from './RSVP';
import React from 'react';
import Travel from './Travel';
import Wedding from './Wedding';
import { PAGES } from '../constants';

class SignedInMain extends React.Component {

    render() {
        return (<>
            {this.props.selection === PAGES.RSVP ? <RSVP auth={this.props.auth} /> :
                this.props.selection === PAGES.WEDDING ? <Wedding /> :
                    this.props.selection === PAGES.TRAVEL ? <Travel /> : null
            }
        </>
        );
    }
}

export default SignedInMain;
